-- Create table
create table CHARDICT
(
  XH   NUMBER(5) not null,
  WORD VARCHAR2(2),
  SRM1 VARCHAR2(2),
  SRM2 VARCHAR2(2),
  SRM3 VARCHAR2(2)
)
tablespace JZGLXT
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 640K
    next 1M
    minextents 1
    maxextents unlimited
    pctincrease 0
  );
-- Create/Recreate primary, unique and foreign key constraints 
alter table CHARDICT
  add constraint PK_CHARDICT primary key (XH)
  using index 
  tablespace JZGLXT
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 896K
    next 1M
    minextents 1
    maxextents unlimited
    pctincrease 0
  );
